Description:                               =
============================================

A man shows up on your doorstep asking you to track down the woman he loves. It would be just another &quot;missing persons&quot; case, except the only thing you have to go on is a crystal slipper... and the man is a prince from a mysterious, faraway land. Can you find the woman who captured his heart but then vanished? Or will this fantastical land push your detective skills to the limit? And do you really get to ride a unicorn? Find out in Detective Quest: The Crystal Slipper!

============================================
Collectors Edition Features:               =
============================================

More adventures in the bonus game
Integrated strategy guide
Gorgeous wallpapers and concept art
Downloadable soundtrack

